import React from 'react';
import {Link} from 'react-router-dom';
import classes from "./navbar.css";
import './navbar.css';
const Navbar = () => (

    <nav className={classes.left_navlinks}>
        <ul>
            <li>
                <Link  >BloggIt</Link>
            </li>
            <li>
                <Link to="/articleslist" activeClassName={classes.active}>Articles</Link>
            </li>
            <li>
                <Link to="/about" activeClassName={classes.active} >About</Link>
            </li>
            <li>
                <Link to="/" activeClassName={classes.active} >Home</Link>
            </li>
        </ul>
    </nav>
);
export default Navbar;
